import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText } from '@material-ui/core';
import { Home as HomeIcon, People as PeopleIcon, Info as InfoIcon } from '@material-ui/icons';
import './App.css'; // Import the CSS file for styling
import logo from './assets/logo.png'; // Import the logo image
import Introduction from './Introduction';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Container, Box, AppBar, Toolbar, TextField, Button } from '@material-ui/core';



<Introduction/>


const useStylesss = makeStyles((theme) => ({
  root: {
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.common.white,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(6),
    textAlign: 'center',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    width: '100%',
    maxWidth: '100%',
  },
  footer: {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.common.white,
    padding: theme.spacing(2),
    textAlign: 'center',
  },
  teamMember: {
    margin: theme.spacing(2),
    padding: theme.spacing(2),
    backgroundColor: theme.palette.common.white,
    borderRadius: theme.spacing(1),
    boxShadow: theme.shadows[1],
    width: 300,
    textAlign: 'center',
  },
}));

const Team = () => {
  const classes = useStylesss();

  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.header}>
        <Toolbar>
          <Typography variant="h6">Arthmate</Typography>
        </Toolbar>
      </AppBar>
      <Container>
        <Box className={classes.content}>
          <Typography variant="h2">Our Team</Typography>
          <Typography variant="body1">
            Meet the dedicated team behind Arthmate, working tirelessly to provide innovative fintech solutions to our customers.
          </Typography>
          <Box className={classes.teamMember}>
            <Typography variant="h5">Ranjan Kant</Typography>
            <Typography variant="subtitle1">CEO</Typography>
          </Box>
          <Box className={classes.teamMember}>
            <Typography variant="h5">Kaustubh DasGupta</Typography>
            <Typography variant="subtitle1">CTO</Typography>
          </Box>
          <Box className={classes.teamMember}>
            <Typography variant="h5">Balijeet Kaur</Typography>
            <Typography variant="subtitle1">CFO</Typography>
          </Box>
        </Box>
      </Container>
      <footer className={classes.footer}>
        <Typography variant="body2">© {new Date().getFullYear()} Arthmate. All rights reserved.</Typography>
      </footer>
    </div>
  );
};

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.common.white,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(6),
    textAlign: 'center',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    width: '100%',
    maxWidth: '100%',
  },
  footer: {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.common.white,
    padding: theme.spacing(2),
    textAlign: 'center',
  },
}));

const About = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.header}>
        <Toolbar>
          <Typography variant="h6">Arthmate</Typography>
        </Toolbar>
      </AppBar>
      <Container>
        <Box className={classes.content}>
          <Typography variant="h2">About</Typography>
          <Typography variant="body1">
            Arthmate is a leading fintech platform providing cutting-edge financial solutions to businesses and individuals. Our mission is to simplify the lending process and make credit accessible to everyone.
          </Typography>
        </Box>
      </Container>
      <footer className={classes.footer}>
        <Typography variant="body2">© {new Date().getFullYear()} Arthmate. All rights reserved.</Typography>
      </footer>
    </div>
  );
};

const HomePage = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  const sidebarItems = [
    { label: 'Home', icon: <HomeIcon />, to: '/' },
    { label: 'Team', icon: <PeopleIcon />, to: '/team' },
    { label: 'About', icon: <InfoIcon />, to: '/about' },
  ];

  return (
    <Router>
      <div>
        <AppBar position="static">
          <Toolbar>
            <Button onClick={toggleSidebar}>Open Sidebar</Button>
            <Typography variant="h6" style={{ flexGrow: 1, marginLeft: '20px' }}>
              Arthmate
            </Typography>
          </Toolbar>
        </AppBar>
        <Drawer open={isSidebarOpen} onClose={toggleSidebar}>
          <List>
            {sidebarItems.map((item) => (
              <ListItem button key={item.label} component={Link} to={item.to}>
                <ListItemIcon>{item.icon}</ListItemIcon>
                <ListItemText primary={item.label} />
              </ListItem>
            ))}
          </List>
        </Drawer>
        <Routes>
          <Route path="/" element={<Introduction />} />
          <Route path="/team" element={<Team />} />
          <Route path="/about" element={<About />} />
        </Routes>
      </div>
    </Router>
  );
};

export default HomePage;
